deck_description:
With this deck, your main goal is to special summon as many salamangreat monsters as possible for tribute power so you can bring out a 10,000+ Ra protected by blaze cannon! Guardian slime and Eqyptian God slime are there if all else fails and you can't get enough tributes on the field for Ra. Link like crazy, nuke your opponent's field with pyro phoenix, then swing for game with Ra!

&nbsp;

(Thank you for suggestions on improvements to my deck. It's really fun watching my deck evolve!)

I've been trying to test some engines to go with my Waifus so I tried Eldlich and It went pretty well unless you're being OTKed.

The extra deck is kinda useless so you can run the pots , I didn't put them because I was going for a budget version..

&nbsp;

Don't play this. At least if youre going to I unironically think you need to make it a 12-card extra or just cut erupt.

&nbsp;

see the deck played here: https://youtu.be/3RmVTU0zm04

Wish i could find something other than a dragoon package, but this deck literally does not have a turn 1 without it.

&nbsp;

see the deck played here: https://youtu.be/KOVsfjjf4cE

Similar idea to Invoked Dog. You got a very consistent engine that sets up a very big very good omni negate supplement with Dogmatika and then a bunch of handtraps.

&nbsp;

See the deck played here: https://youtu.be/IVPcY7Tsr9o

